import React from "react";
import CatCard from "./CatCard";

function CatList({
  cats
}) {
  return (
    <div className="cards">
      {cats.map((cat) => (
      <CatCard 
            key={cat.id}
            id={cat.id}
            image={cat.url}
            name={cat.name}
            favoritemovie={cat.favoriteMovie}
            age={cat.age}
        />
      ))}
    </div>
  );
}

export default CatList;
